static void DrawCircle(v2_t position, float radius, v4_t color)
{
	glPushMatrix();
	glTranslatef(position.x, position.y, 0.0f);
	glScalef(radius, radius, 0.0f);
	glBegin(GL_LINE_LOOP);
	for (float degrees = 0.0f; degrees < 360.0f; degrees += (360.0f / (16.0f)))
	{
		glColor4fv(&color.x);
		glVertex2f(Sin(degrees), Cos(degrees));
	}
	glEnd();
	glPopMatrix();
}

typedef struct
{
	GLuint TextureHandle;
	v2_t TexScale;
	float PixelHeight;
} font_t;

static void DrawString(font_t* font, v2_t position, const char *string, v4_t color)
{
	glEnable(GL_TEXTURE_2D);
	glEnable(GL_BLEND);
	glBlendFunc(GL_SRC_ALPHA, GL_ONE_MINUS_SRC_ALPHA);
	glBindTexture(GL_TEXTURE_2D, font->TextureHandle);
	const char* at = string;
	while (*at++)
	{
		int32_t codepoint = (int32_t) toupper(*(at - 1));
		if (codepoint >= 32 && codepoint <= 126)
		{
			int32_t xOff = (codepoint % 16);
			int32_t yOff = (codepoint / 16);
			v2_t uv_min = V2((float)(8 * xOff), (float)(8 * yOff));
			v2_t uv_max = Add(uv_min, V2(8.0f, 8.0f));
			uv_min = Mul(uv_min, font->TexScale);
			uv_max = Mul(uv_max, font->TexScale);
			v2_t min = position;
			v2_t max = V2(min.x + font->PixelHeight, min.y + font->PixelHeight);
			glBegin(GL_QUADS);
			glColor4fv(&color.x);
			glTexCoord2f(uv_min.x, uv_min.y); glVertex2f(min.x, min.y);
			glTexCoord2f(uv_max.x, uv_min.y); glVertex2f(max.x, min.y);
			glTexCoord2f(uv_max.x, uv_max.y); glVertex2f(max.x, max.y);
			glTexCoord2f(uv_min.x, uv_max.y); glVertex2f(min.x, max.y);
			glEnd();
			position.x += font->PixelHeight;
		}
	}

	glDisable(GL_TEXTURE_2D);
	glBindTexture(GL_TEXTURE_2D, 0);
}

static void DrawStringCentered(font_t* font, v2_t position,
	const char* string, v4_t color)
{
	int32_t length = (int32_t)strlen(string);
	float width = ((float)length * font->PixelHeight);
	position.x -= width / 2.0f;
	DrawString(font, position, string,color);
}

static void DrawShipShape(v2_t position, float angle, float radius, v4_t color)
{
	glPushMatrix();
	glTranslatef(position.x, position.y, 0.0f);
	glRotatef(angle, 0.0f, 0.0f, 1.0f);
	glBegin(GL_LINE_LOOP);
	glColor4f(1.0f, 1.0f, 1.0f, 1.0f);
	glVertex2f(0.0f, -1.0f - radius * 1.2f);
	glVertex2f(0.0f - (radius) + (radius * 0.0f), -1.0f + radius);
	glVertex2f(0.0f + (radius) - (radius * 0.0f), -1.0f + radius);
	glEnd();
	glPopMatrix();
}